import logo from './logo.svg';
import './App.css';

function App() {
  const logo = "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQWcOhU4Ej0qKpZrjffn3KwbyD9quINYnlCrw&usqp=CAU";  
  return (
   <div>
    <img src={logo} alt="banner" />
    <div></div>
   </div>
  );
}

export default App;
